import React, { useState } from "react";
import { navButton } from "./Buttons";


function HomePage(){
    return(
        <div>

            <div>
                <navButton 
                        text="1 vs 1"
                        onClick={null}
                />
            </div>

            <div>
                <navButton 
                        text="1 vs Computer"
                        onClick={null}
                />
            </div>

            <div>
                <navButton 
                text="Computer vs Computer"
                onClick={null}
                />
            </div>

            <div>
                <navButton 
                    text="Simulation"
                    onClick={null}
                />
            </div>

        </div>
    )
}

export default HomePage;
